@StephAntone We're so pleased to hear that!
Thank you for sharing.
If you could please send us a direct message with your daughter's full name and reservation code, we'd love to pass this along to Jenna. https://t.co/o7MlHGd5Wh

@MMitchenor Hello Michelle,
We are sorry to see that your luggage has been delayed. If you could send us a direct message with your full name, six letter reservation code, email, and delayed baggage claim, and we would be happy to look into this for you. 

~Kia

@drewericksonca Hello!
Can you have the guest DM us with the information, and we will look into this for them. 
Thank you ~Almira

@GeorgeOlduvai We'd have to take a look at the reservation.
If you need our help, please send us a direct message with your request, your full name, reservation code and where you are booked to fly from and to.
For details on bringing a pet in the cabin, click here: https://t.co/04RtNCYhGr. https://t.co/o7MlHGd5Wh

@Mich_Kane Our apologies for the frustration you're feeling.
We can assure you claims are being reviewed carefully and payments are being made.
We have received countless questions from guests when it comes to accepting their payments.

@ditto917 Thank you for reaching out about your Air Passenger Protection Regulations (APPR) claim.
Claims are adjudicated carefully by our APPR agents, and decisions are final.
The reason for a delay can change, as it's based on the cause that results in the longest delay.

@ormelling1 Hello! 
Can you please send us a direct message with your six-letter reservation code, your full name on the booking, and the email address associated with the reservation? We would be happy to look into this for you. 
~Slater
